import './clerkHeader.css'

function ClerkHeader() {
    return (
        <div className="clerk-header">
            <button>View Rooms</button>
            <button>Check in/out</button>
            <button>Modify Reservation</button>
            <button>Get Billing Info</button>
            <button>Reserve Room</button>
        </div>
    )
}

export default ClerkHeader
